import React from 'react';
import '../styles/UserProfile.css';

function UserProfile({ user }) {
  return (
    <div className="user-profile">
      <img src={user.avatarUrl} alt="User Avatar" />
      <h2>{user.username}</h2>
      <p><strong>Following:</strong> {user.followingCount}</p>
      <p><strong>Followers:</strong> {user.followerCount}</p>
      <p><strong>Likes:</strong> {user.likesCount}</p>
      <button className="button" onClick={user.onGeneratePersonaAnalysis}>Generate Persona Analysis</button>
    </div>
  );
}

export default UserProfile;
